import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link, useNavigate } from 'react-router-dom';

// Define a NavBar component for reuse in ProductsList
const NavBar = ({ token }) => {
    return (
        <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
            <div className="container">
                <Link className="navbar-brand" to="/">Tersano</Link>
                <div className="navbar-collapse">
                    <ul className="navbar-nav ml-auto">
                        {!token ? (
                            <>
                                <li className="nav-item">
                                    <Link className="nav-link" to="/login">Login</Link>
                                </li>
                                <li className="nav-item">
                                    <Link className="nav-link" to="/signup">Signup</Link>
                                </li>
                            </>
                        ) : (
                            <li className="nav-item">
                                <button className="nav-link btn btn-link" onClick={() => {
                                    localStorage.removeItem('token');
                                    window.location.reload(); // Refresh the page to reflect logout
                                }}>Logout</button>
                            </li>
                        )}
                    </ul>
                </div>
            </div>
        </nav>
    );
};

const ProductsList = () => {
    const [products, setProducts] = useState([]);
    const [showLoginPrompt, setShowLoginPrompt] = useState(false);
    const token = localStorage.getItem('token');
    const navigate = useNavigate();

    useEffect(() => {
        const fetchProducts = async () => {
            try {
                const response = await axios.get('http://localhost:4000/api/products');
                setProducts(response.data);
            } catch (error) {
                console.error('Failed to fetch products:', error.response?.data || 'Server error');
            }
        };
        fetchProducts();
    }, []);

    const deleteProduct = async (productId) => {
        if (!token) {
            console.error('Not authorized');
            return;
        }
        try {
            await axios.delete(`http://localhost:4000/api/products/${productId}`, {
                headers: { Authorization: `Bearer ${token}` },
            });
            setProducts(currentProducts => currentProducts.filter(product => product._id !== productId));
        } catch (error) {
            console.error('Error deleting product:', error.response?.data || 'Server error');
        }
    };

    const handleProductManagementClick = () => {
        if (!token) {
            setShowLoginPrompt(true);
        } else {
            navigate('/product-management');
        }
    };

    return (
        <>
            <NavBar token={token} />
            <div className="container mt-4">
                <h1>Tersano Products</h1>
                <div className="mb-3">
                    <button onClick={handleProductManagementClick} className={`btn ${token ? 'btn-primary' : 'btn-secondary'}`} disabled={!token}>
                        Product Management
                    </button>
                    {showLoginPrompt && (
                        <div className="alert alert-warning mt-2">
                            Please <Link to="/login">login</Link> to manage products.
                        </div>
                    )}
                </div>
                {products.length === 0 ? (
                    <p className="text-center">There is nothing to show right now.</p>
                ) : (
                    <div className="row">
                        {products.map(product => (
                            <div className="col-md-4 mb-3" key={product._id}>
                                <div className="card h-100">
                                    <div className="card-body">
                                        <h5 className="card-title">{product.name}</h5>
                                        <p className="card-text">{product.description}</p>
                                        <p className="card-text">${product.price}</p>
                                        {token && (
                                            <button onClick={() => deleteProduct(product._id)} className="btn btn-danger">
                                                Delete
                                            </button>
                                        )}
                                    </div>
                                </div>
                            </div>
                        ))}
                    </div>
                )}
            </div>
        </>
    );
};

export default ProductsList;
